import { useState, useEffect } from 'react'
import './CarsList.css'

const apiUrl = 'http://localhost:8000/api/cars'

function CardList() {
    const [cars, setCars] = useState([])

    const getAllCars = async () => {
        try {
            const response = await fetch(apiUrl)
            const data = await response.json()
            setCars(data)

        } catch (error) {
            console.log(error);
        }
    }

    useEffect(() => {
        getAllCars()
    }, [])

    return (
        <div className = 'cardGeral'>
        {
            cars.map((oneCar) => {
                return (
                    <div className = 'card'>
                        {oneCar.BRAND}
                        {oneCar.MODEL}
                                {oneCar.DEALER}
                                {oneCar.MIN_MILEAGE}
                                {oneCar.MAX_MILEAGE}
                    </div>
                )
            })
        }
    </div>
    );
}

export default CardList;
